import Carousel from '../components/Carousel.js'
import mockup4 from '../photo_assets/Flavours/mockup4.jpeg'

const slides = [
    { image:
        mockup4},
    {image:
        '../photo_assets/Flavours/ice-cream-mockup-5.jpg'},
    {image:
        '../photo_assets/Flavours/ice-cream-mockup-6.jpg'}
] //throw this in the back end when its up****

const Home=()=>{
    return (
        <div>            
            Home page
            <Carousel slides={slides}/>
        </div>
    )
};

export default Home;
